import React from 'react';
import Step from "./Step"

function App() {
    return (
        <div>
            <div>
                <Step title="Step 1: Your Details"/>
                <Step title="Step 2: More Comments"/>
                <Step title="Step 3: Final Comments"/>
            </div>
        </div>
    )
}

export default App;
